<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_VII_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 VII (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u043c VII<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1724_%D0%B3%D0%BE%D0%B4\" title=\"1724 \u0433\u043e\u0434\">1724<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u00ab\u0421\u0442\u0440\u0430\u0441\u0442\u0435\u0439 \u043f\u043e \u0418\u043e\u0430\u043d\u043d\u0443\u00bb (\u00abJohannes-Passion\u00bb) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%85,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%A1%D0%B5%D0%B1%D0%B0%D1%81%D1%82%D1%8C%D1%8F%D0%BD\" title=\"\u0411\u0430\u0445, \u0418\u043e\u0433\u0430\u043d\u043d \u0421\u0435\u0431\u0430\u0441\u0442\u044c\u044f\u043d\">\u0418.&#160;\u0421.&#160;\u0411\u0430\u0445\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B9%D0%BF%D1%86%D0%B8%D0%B3\" title=\"\u041b\u0435\u0439\u043f\u0446\u0438\u0433\">\u041b\u0435\u0439\u043f\u0446\u0438\u0433<\/a> (Nikolaikirche, \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%BF%D1%8F%D1%82%D0%BD%D0%B8%D1%86%D0%B0\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u043f\u044f\u0442\u043d\u0438\u0446\u0430\">\u0412\u0435\u043b\u0438\u043a\u0443\u044e \u041f\u044f\u0442\u043d\u0438\u0446\u0443<\/a>)<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1738_%D0%B3%D0%BE%D0%B4\" title=\"1738 \u0433\u043e\u0434\">1738<\/a>&#160;\u2014 \u041f\u0430\u043f\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D0%BC%D0%B5%D0%BD%D1%82_XII\" title=\"\u041a\u043b\u0438\u043c\u0435\u043d\u0442 XII\">\u041a\u043b\u0438\u043c\u0435\u043d\u0442 XII<\/a> \u043e\u0441\u043e\u0431\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%BB%D0%B0\" title=\"\u0411\u0443\u043b\u043b\u0430\">\u0431\u0443\u043b\u043b\u043e\u0439<\/a> \u043e\u0431\u0432\u0438\u043d\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D0%BE%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041c\u0430\u0441\u043e\u043d\u0441\u0442\u0432\u043e\">\u0432\u043e\u043b\u044c\u043d\u044b\u0445 \u043a\u0430\u043c\u0435\u043d\u0449\u0438\u043a\u043e\u0432<\/a> \u0432 \u043b\u0438\u0446\u0435\u043c\u0435\u0440\u0438\u0438, \u043f\u0440\u0438\u0442\u0432\u043e\u0440\u0441\u0442\u0432\u0435, \u0435\u0440\u0435\u0441\u0438 \u0438 \u0438\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u044f\u0445. \u0412 \u043e\u0441\u043e\u0431\u0443\u044e \u0432\u0438\u043d\u0443 \u0438\u043c \u0431\u044b\u043b\u0430 \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0430 \u0442\u0430\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0438 \u0441\u043a\u0440\u044b\u0442\u043d\u043e\u0441\u0442\u044c. \u0412\u0438\u043d\u043e\u0432\u043d\u044b\u043c \u0432 \u043f\u0440\u0438\u043d\u0430\u0434\u043b\u0435\u0436\u043d\u043e\u0441\u0442\u0438 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D0%BE%D0%BD%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041c\u0430\u0441\u043e\u043d\u0441\u0442\u0432\u043e\">\u043c\u0430\u0441\u043e\u043d\u0441\u0442\u0432\u0443<\/a> \u0433\u0440\u043e\u0437\u0438\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D0%BB%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BE%D1%82_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8\" title=\"\u041e\u0442\u043b\u0443\u0447\u0435\u043d\u0438\u0435 \u043e\u0442 \u0446\u0435\u0440\u043a\u0432\u0438\">\u043e\u0442\u043b\u0443\u0447\u0435\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1767_%D0%B3%D0%BE%D0%B4\" title=\"1767 \u0433\u043e\u0434\">1767<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Burmese%E2%80%93Siamese_War_%281765%E2%80%9367%29\">\u0411\u0438\u0440\u043c\u0430\u043d\u043e-\u0421\u0438\u0430\u043c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b 1765\u20141767 \u0433\u043e\u0434\u043e\u0432<\/a>, \u0431\u0438\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u0432\u0437\u044f\u0442\u0430 \u0448\u0442\u0443\u0440\u043c\u043e\u043c \u0438 \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8E%D1%82%D1%82%D1%85%D0%B0%D1%8F\" title=\"\u0410\u044e\u0442\u0442\u0445\u0430\u044f\">\u0410\u044e\u0442\u0442\u0445\u0430\u044f<\/a>, \u0441\u0442\u043e\u043b\u0438\u0446\u0430 \u043e\u0434\u043d\u043e\u0438\u043c\u0451\u043d\u043d\u043e\u0433\u043e \u0446\u0430\u0440\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8E%D1%82%D0%B8%D1%8F_(%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0410\u044e\u0442\u0438\u044f (\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e)\">\u0410\u044e\u0442\u0442\u0445\u0430\u044f<\/a> \u0438 \u0441\u0442\u0430\u0432\u0448\u0435\u0435 \u0435\u0433\u043e \u043a\u043e\u043d\u0446\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BB%D0%B8%D0%BC_III\" title=\"\u0421\u0435\u043b\u0438\u043c III\">\u0421\u0435\u043b\u0438\u043c III<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%83%D0%BB%D1%82%D0%B0%D0%BD%D0%BE%D0%B2_%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u0441\u0443\u043b\u0442\u0430\u043d\u043e\u0432 \u041e\u0441\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0441\u0443\u043b\u0442\u0430\u043d\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1793_%D0%B3%D0%BE%D0%B4\" title=\"1793 \u0433\u043e\u0434\">1793<\/a>&#160;\u2014 \u0413\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D0%B5%D1%86-%D0%9F%D0%BE%D0%B4%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u041a\u0430\u043c\u0435\u043d\u0435\u0446-\u041f\u043e\u0434\u043e\u043b\u044c\u0441\u043a\u0438\u0439\">\u041a\u0430\u043c\u0435\u043d\u0435\u0446-\u041f\u043e\u0434\u043e\u043b\u044c\u0441\u043a\u0438\u0439<\/a> \u0432\u043e\u0448\u0435\u043b \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u0442 \u0437\u0430\u043a\u043e\u043d, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u0432\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D0%BC%D0%B5%D1%80\" title=\"\u041c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043c\u0435\u0440\">\u043c\u0435\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443<\/a> \u0438 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u043b \u0435\u0434\u0438\u043d\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BB%D0%B8%D0%BD%D0%B0\" title=\"\u0414\u043b\u0438\u043d\u0430\">\u0434\u043b\u0438\u043d\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80\" title=\"\u041c\u0435\u0442\u0440\">\u043c\u0435\u0442\u0440<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%B0\" title=\"\u041c\u0430\u0441\u0441\u0430\">\u043c\u0430\u0441\u0441\u044b<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC\" title=\"\u041a\u0438\u043b\u043e\u0433\u0440\u0430\u043c\u043c\">\u043a\u0438\u043b\u043e\u0433\u0440\u0430\u043c\u043c<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1803_%D0%B3%D0%BE%D0%B4\" title=\"1803 \u0433\u043e\u0434\">1803<\/a>&#160;\u2014 \u0412 \u00ab\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0445 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u0438\u0445 \u0432\u0435\u0434\u043e\u043c\u043e\u0441\u0442\u044f\u0445\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0443\u043f\u043e\u0442\u0440\u0435\u0431\u043b\u0435\u043d\u043e \u0441\u043b\u043e\u0432\u043e\u0441\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u0435 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D1%8B%D0%B9_%D1%82%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u0416\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u044b\u0439 \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\">\u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430<\/a>\u00bb. \u0414\u043e \u044d\u0442\u043e\u0433\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0441\u044f \u0442\u0435\u0440\u043c\u0438\u043d \u00ab\u0447\u0443\u0433\u0443\u043d\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u0441\u0438\u043c\u0444\u043e\u043d\u0438\u0438 \u2116&#160;3 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%82%D1%85%D0%BE%D0%B2%D0%B5%D0%BD,_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3_%D0%B2%D0%B0%D0%BD\" title=\"\u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d, \u041b\u044e\u0434\u0432\u0438\u0433 \u0432\u0430\u043d\">\u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d\u0430<\/a> \u00abEroica\u00bb, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0430<\/a> (Theater an der Wien), \u0434\u0438\u0440. \u0430\u0432\u0442\u043e\u0440 (\u0432 \u043f\u0440\u0438\u0432\u0430\u0442\u043d\u044b\u0445 \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u0430\u0445 \u0441\u0438\u043c\u0444\u043e\u043d\u0438\u044f \u0438\u0441\u043f\u043e\u043b\u043d\u044f\u043b\u0430\u0441\u044c \u0432 1804 \u0433\u043e\u0434\u0443)<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1823_%D0%B3%D0%BE%D0%B4\" title=\"1823 \u0433\u043e\u0434\">1823<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%B2%D0%B5%D0%BD%D1%86%D0%B8%D1%8F_%D0%B2_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8E\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0438\u043d\u0442\u0435\u0440\u0432\u0435\u043d\u0446\u0438\u044f \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u044e\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0438\u043d\u0442\u0435\u0440\u0432\u0435\u043d\u0446\u0438\u044f \u0432 \u0418\u0441\u043f\u0430\u043d\u0438\u044e<\/a> \u0441 \u0446\u0435\u043b\u044c\u044e \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0430\u0431\u0441\u043e\u043b\u044e\u0442\u0438\u0441\u0442\u0441\u043a\u0438\u0439 \u0440\u0435\u0436\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4_VII\" title=\"\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 VII\">\u0424\u0435\u0440\u043d\u0430\u043d\u0434\u043e VII<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1827_%D0%B3%D0%BE%D0%B4\" title=\"1827 \u0433\u043e\u0434\">1827<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D1%80%D0%BC%D0%B0%D1%86%D0%B5%D0%B2%D1%82%D0%B8%D0%BA%D0%B0\" title=\"\u0424\u0430\u0440\u043c\u0430\u0446\u0435\u0432\u0442\u0438\u043a\u0430\">\u0444\u0430\u0440\u043c\u0430\u0446\u0435\u0432\u0442<\/a> \u0414\u0436\u043e\u043d \u0423\u043e\u043a\u0435\u0440 \u043d\u0430\u0447\u0430\u043b \u043f\u0440\u043e\u0434\u0430\u0432\u0430\u0442\u044c \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0451\u043d\u043d\u044b\u0435 \u0438\u043c \u0436\u0435 \u0440\u0430\u043d\u0435\u0435 \u0441\u0435\u0440\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%87%D0%BA%D0%B0\" title=\"\u0421\u043f\u0438\u0447\u043a\u0430\">\u0441\u043f\u0438\u0447\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1831_%D0%B3%D0%BE%D0%B4\" title=\"1831 \u0433\u043e\u0434\">1831<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%B4%D1%80%D1%83_II_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D0%B8)\" title=\"\u041f\u0435\u0434\u0440\u0443 II (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438)\">\u041f\u0435\u0434\u0440\u0443 II<\/a> \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u043e\u043c \u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438<\/a> \u043f\u043e\u0441\u043b\u0435 \u043e\u0442\u0440\u0435\u0447\u0435\u043d\u0438\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u043e\u0442\u0446\u0430, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%B4%D1%80%D1%83_I_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D0%B8)\" title=\"\u041f\u0435\u0434\u0440\u0443 I (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438)\">\u041f\u0435\u0434\u0440\u0443 I<\/a>. \u041e\u043f\u0435\u043a\u0443\u043d\u043e\u043c \u044e\u043d\u043e\u0433\u043e \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5_%D0%90%D0%BD%D0%B4%D1%80%D0%B0%D0%B4%D0%B0_%D0%B8_%D0%A1%D0%B8%D0%BB%D0%B2%D0%B0,_%D0%96%D0%BE%D0%B7%D0%B5_%D0%91%D0%BE%D0%BD%D0%B8%D1%84%D0%B0%D1%81%D0%B8%D1%83\" title=\"\u0414\u0435 \u0410\u043d\u0434\u0440\u0430\u0434\u0430 \u0438 \u0421\u0438\u043b\u0432\u0430, \u0416\u043e\u0437\u0435 \u0411\u043e\u043d\u0438\u0444\u0430\u0441\u0438\u0443\">\u0416\u043e\u0437\u0435 \u0411\u043e\u043d\u0438\u0444\u0430\u0441\u0438\u0443 \u0434\u0435 \u0410\u043d\u0434\u0440\u0430\u0434\u0430 \u0438 \u0421\u0438\u043b\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1862_%D0%B3%D0%BE%D0%B4\" title=\"1862 \u0433\u043e\u0434\">1862<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A1%D0%A8%D0%90\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0421\u0428\u0410\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 \u0421\u0428\u0410<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A8%D0%B0%D0%B9%D0%BB%D0%BE\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0428\u0430\u0439\u043b\u043e\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0428\u0430\u0439\u043b\u043e<\/a>, \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0435\u0435\u0441\u044f \u043f\u043e\u0431\u0435\u0434\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u0421\u043e\u044e\u0437\u0430.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412\u0432\u0435\u0434\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B5%D0%BC%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0420\u043e\u0441\u0441\u0438\u0438\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u043c \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c<\/a> \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0445\u043b\u0435\u0431\u043d\u043e\u0439 \u043c\u043e\u043d\u043e\u043f\u043e\u043b\u0438\u0438 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u041f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u0431\u0440\u0438\u0442\u0430\u043d\u043a\u0438 \u0412\u0438\u043e\u043b\u0435\u0442\u0442\u044b \u0413\u0438\u0431\u0441\u043e\u043d \u043d\u0430 \u0436\u0438\u0437\u043d\u044c \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u0433\u043e \u0434\u0438\u043a\u0442\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE_%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8\" class=\"mw-redirect\" title=\"\u0411\u0435\u043d\u0438\u0442\u043e \u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438\">\u0411\u0435\u043d\u0438\u0442\u043e \u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a> (\u043f\u0443\u043b\u044f \u043b\u0438\u0448\u044c \u0437\u0430\u0434\u0435\u043b\u0430 \u0435\u0433\u043e \u043d\u043e\u0441).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439<\/a> \u0443\u0447\u0451\u043d\u044b\u0439 \u0413\u0435\u0440\u0431\u0435\u0440\u0442 \u0410\u0439\u0432\u0441 \u043f\u0440\u043e\u0432\u0451\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u043e\u0435 \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u043e\u0435 \u0432\u0435\u0449\u0430\u043d\u0438\u0435 \u043d\u0430 \u0431\u043e\u043b\u044c\u0448\u043e\u0435 \u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 (\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%94%D0%B6%D0%B5%D1%80%D1%81%D0%B8\" title=\"\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438\">\u041d\u044c\u044e-\u0414\u0436\u0435\u0440\u0441\u0438<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>), \u043f\u0435\u0440\u0435\u0434\u0430\u0432 \u0447\u0435\u0440\u0435\u0437 \u0442\u0435\u043b\u0435\u0432\u0438\u0437\u0438\u043e\u043d\u043d\u044b\u0435 \u0441\u0435\u0442\u0438 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0442\u043e\u0433\u0434\u0430\u0448\u043d\u0435\u0433\u043e \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B2%D0%B5%D1%80,_%D0%93%D0%B5%D1%80%D0%B1%D0%B5%D1%80%D1%82_%D0%9A%D0%BB%D0%B0%D1%80%D0%BA\" class=\"mw-redirect\" title=\"\u0413\u0443\u0432\u0435\u0440, \u0413\u0435\u0440\u0431\u0435\u0440\u0442 \u041a\u043b\u0430\u0440\u043a\">\u0413\u0435\u0440\u0431\u0435\u0440\u0442\u0430 \u0413\u0443\u0432\u0435\u0440\u0430<\/a>, \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0428\u0410\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u043e \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%9D%D0%9A_%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u041d\u041a \u0421\u0421\u0421\u0420\">\u0421\u041d\u041a \u0421\u0421\u0421\u0420<\/a> \u00ab\u041f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043e\u0431 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE-%D1%82%D1%80%D1%83%D0%B4%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BB%D0%B0%D0%B3%D0%B5%D1%80%D1%8C\" title=\"\u0418\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e-\u0442\u0440\u0443\u0434\u043e\u0432\u043e\u0439 \u043b\u0430\u0433\u0435\u0440\u044c\">\u0438\u0441\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u043e-\u0442\u0440\u0443\u0434\u043e\u0432\u044b\u0445 \u043b\u0430\u0433\u0435\u0440\u044f\u0445<\/a>\u00bb, \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u043d\u044b\u0445 \u0432 \u043f\u043e\u0434\u0447\u0438\u043d\u0435\u043d\u0438\u0435 \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u043c\u0443 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/25_%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8F\" title=\"25 \u0430\u043f\u0440\u0435\u043b\u044f\">25 \u0430\u043f\u0440\u0435\u043b\u044f<\/a>) \u0413\u043b\u0430\u0432\u043d\u043e\u043c\u0443 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u043b\u0430\u0433\u0435\u0440\u0435\u0439 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%A3%D0%9B%D0%B0%D0%B3\" class=\"mw-redirect\" title=\"\u0413\u0423\u041b\u0430\u0433\">\u0413\u0423\u041b\u0430\u0433<\/a>) \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B5_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%9D%D0%9A%D0%92%D0%94_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041d\u041a\u0412\u0414 \u0420\u0421\u0424\u0421\u0420\">\u041e\u0413\u041f\u0423<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u041f\u0440\u0438\u043a\u0430\u0437\u043e\u043c \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0438\u0430\u0442\u0430 \u0441\u043d\u0430\u0431\u0436\u0435\u043d\u0438\u044f \u0421\u0421\u0421\u0420 \u0431\u044b\u043b \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d \u0413\u043b\u0430\u0432\u0440\u044b\u0431\u0432\u043e\u0434, \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u043e\u043c \u0440\u044b\u0431\u043e\u043e\u0445\u0440\u0430\u043d\u043d\u044b\u0445 \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u0439 \u043d\u0430 \u0440\u044b\u0431\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0432\u043e\u0434\u043e\u0435\u043c\u0430\u0445 \u0420\u043e\u0441\u0441\u0438\u0438. \u042d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f \u0434\u043d\u0435\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u043e\u0440\u0433\u0430\u043d\u043e\u0432 \u0440\u044b\u0431\u043e\u043e\u0445\u0440\u0430\u043d\u044b .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B8%D1%81%D0%BF%D0%BE%D0%BB%D0%BD%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0442\u0435\u0442 \u0421\u0421\u0421\u0420\">\u0426\u0418\u041a<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u041d\u041a \u0421\u0421\u0421\u0420<\/a> \u00ab\u041e \u043c\u0435\u0440\u0430\u0445 \u0431\u043e\u0440\u044c\u0431\u044b \u0441 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u044c\u044e \u043d\u0435\u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u043e\u043b\u0435\u0442\u043d\u0438\u0445\u00bb. \u0412\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0443\u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0439 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u0438 \u0441 12 \u043b\u0435\u0442 \u00ab\u0441 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u0435\u043c \u0432\u0441\u0435\u0445 \u043c\u0435\u0440 \u0443\u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0433\u043e \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u044f\u00bb, \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/20_%D0%B0%D0%BF%D1%80%D0%B5%D0%BB%D1%8F\" title=\"20 \u0430\u043f\u0440\u0435\u043b\u044f\">20 \u0430\u043f\u0440\u0435\u043b\u044f<\/a>&#160;\u2014 \u0432\u043f\u043b\u043e\u0442\u044c \u0434\u043e \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 \u041d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B1%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0410\u043b\u0431\u0430\u043d\u0438\u044f\">\u0410\u043b\u0431\u0430\u043d\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945<\/a>&#160;\u2014 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0434\u0432\u0443\u0445 \u0430\u0442\u0430\u043a 380-\u0442\u0438 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u0449\u0438\u043a\u043e\u0432 \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439 \u0444\u043b\u0430\u0433\u043c\u0430\u043d \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%BD%D0%B5%D0%B9%D0%BD%D1%8B%D0%B5_%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D0%B8_%D1%82%D0%B8%D0%BF%D0%B0_%C2%AB%D0%AF%D0%BC%D0%B0%D1%82%D0%BE%C2%BB\" title=\"\u041b\u0438\u043d\u0435\u0439\u043d\u044b\u0435 \u043a\u043e\u0440\u0430\u0431\u043b\u0438 \u0442\u0438\u043f\u0430 \u00ab\u042f\u043c\u0430\u0442\u043e\u00bb\">\u042f\u